import React from 'react';
import ProfileCard from '../components/layout/ProfileCard';

const Home = (props) => {
  const authContext = useContext(AuthContext);
  useEffect(() => {
    authContext.loadUser();
    // eslint-disable-next-line
  }, []);
  return (
    <div className="mx-auto">
      <ProfileCard />
    </div>
  );
};

Home.propTypes = {};

export default Home;
